import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const regions = [
  'United States',
  'Canada',
  'Europe',
  'Asia',
  'Australia',
];
const languages = [
  'English',
  'French',
  'Spanish',
  'German',
  'Chinese',
];

const SignupPage = () => {
  const [region, setRegion] = useState('');
  const [language, setLanguage] = useState('');
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [updates, setUpdates] = useState(false);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!region || !language || !firstName || !lastName || !email || !password || !confirmPassword) {
      setError('Please fill in all fields');
      return;
    }
    if (password !== confirmPassword) {
      setError('Passwords do not match');
      return;
    }
    if (password.length < 6) {
      setError('Password must be at least 6 characters');
      return;
    }
    setError('');
    // Send to backend
    try {
      const res = await fetch('/api/auth/signup', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ region, language, firstName, lastName, email, password, updates })
      });
      if (res.ok) {
        navigate('/login');
      } else {
        const data = await res.json();
        setError(data.error || 'Signup failed');
      }
    } catch (err) {
      setError('Network error');
    }
  };

  return (
    <div style={{ minHeight: '100vh', background: '#fff', display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center' }}>
      <form onSubmit={handleSubmit} style={{ width: '100%', maxWidth: 420, margin: '0 auto', background: 'none', boxShadow: 'none', padding: 0 }}>
        <div style={{ marginBottom: 16, color: '#888', fontSize: 17, fontWeight: 500 }}>Create Account</div>
        <h1 style={{ fontSize: '2.2rem', fontWeight: 700, marginBottom: 28 }}>Create Account</h1>
        {error && <div style={{ color: 'red', marginBottom: 16 }}>{error}</div>}
        <label htmlFor="region" style={{ fontWeight: 500, fontSize: 16, marginBottom: 8, display: 'block' }}>Region</label>
        <select id="region" value={region} onChange={e => setRegion(e.target.value)} required style={{ width: '100%', padding: '12px 16px', fontSize: 18, borderRadius: 6, border: '1px solid #ddd', marginBottom: 24, background: '#f5f5f5', color: region ? '#222' : '#888' }}>
          <option value="" disabled>Select Region</option>
          {regions.map(r => <option key={r} value={r}>{r}</option>)}
        </select>
        <label htmlFor="language" style={{ fontWeight: 500, fontSize: 16, marginBottom: 8, display: 'block', color: '#bbb' }}>Language</label>
        <select id="language" value={language} onChange={e => setLanguage(e.target.value)} required style={{ width: '100%', padding: '12px 16px', fontSize: 18, borderRadius: 6, border: '1px solid #ddd', marginBottom: 24, background: '#f5f5f5', color: language ? '#222' : '#bbb' }}>
          <option value="" disabled>Select Language</option>
          {languages.map(l => <option key={l} value={l}>{l}</option>)}
        </select>
        <label htmlFor="firstName" style={{ fontWeight: 500, fontSize: 16, marginBottom: 8, display: 'block' }}>First Name</label>
        <input id="firstName" type="text" value={firstName} onChange={e => setFirstName(e.target.value)} required style={{ width: '100%', padding: '12px 16px', fontSize: 18, borderRadius: 6, border: '1px solid #ddd', marginBottom: 24, background: '#fafafa' }} />
        <label htmlFor="lastName" style={{ fontWeight: 500, fontSize: 16, marginBottom: 8, display: 'block' }}>Last Name</label>
        <input id="lastName" type="text" value={lastName} onChange={e => setLastName(e.target.value)} required style={{ width: '100%', padding: '12px 16px', fontSize: 18, borderRadius: 6, border: '1px solid #ddd', marginBottom: 24, background: '#fafafa' }} />
        <label htmlFor="email" style={{ fontWeight: 500, fontSize: 16, marginBottom: 8, display: 'block' }}>Email</label>
        <input id="email" type="email" value={email} onChange={e => setEmail(e.target.value)} required style={{ width: '100%', padding: '12px 16px', fontSize: 18, borderRadius: 6, border: '1px solid #ddd', marginBottom: 24, background: '#fafafa' }} />
        <label htmlFor="password" style={{ fontWeight: 500, fontSize: 16, marginBottom: 8, display: 'block' }}>Password</label>
        <input id="password" type="password" value={password} onChange={e => setPassword(e.target.value)} required style={{ width: '100%', padding: '12px 16px', fontSize: 18, borderRadius: 6, border: '1px solid #ddd', marginBottom: 24, background: '#fafafa' }} />
        <label htmlFor="confirmPassword" style={{ fontWeight: 500, fontSize: 16, marginBottom: 8, display: 'block' }}>Confirm Password</label>
        <input id="confirmPassword" type="password" value={confirmPassword} onChange={e => setConfirmPassword(e.target.value)} required style={{ width: '100%', padding: '12px 16px', fontSize: 18, borderRadius: 6, border: '1px solid #ddd', marginBottom: 24, background: '#fafafa' }} />
        <div style={{ display: 'flex', alignItems: 'center', marginBottom: 24 }}>
          <input id="updates" type="checkbox" checked={updates} onChange={e => setUpdates(e.target.checked)} style={{ marginRight: 8 }} />
          <label htmlFor="updates" style={{ fontWeight: 500, fontSize: 16 }}>Get Tesla Updates [Optional]</label>
        </div>
        <div style={{ fontSize: 15, color: '#444', marginBottom: 32, lineHeight: 1.6 }}>
          By clicking 'Create Account', I authorize Tesla to contact me with more information about Tesla products, services and regional events via the contact information I provide. I understand calls or texts may use automatic or computer-assisted dialing or pre-recorded messages. Normal message and data rates apply. I can opt out at any time in the Tesla app or by <a href="#" style={{ color: '#3957ff' }}>unsubscribing</a>.
        </div>
        <button type="submit" style={{ width: '100%', background: '#a3bffa', color: '#fff', fontWeight: 600, fontSize: 18, borderRadius: 6, padding: '14px 0', border: 'none', marginBottom: 8, cursor: 'pointer' }}>Create Account</button>
      </form>
    </div>
  );
};

export default SignupPage;
